package ot

import (
	"testing"
)

func newTestDocument() Document {
	return Document{
		checksums: make(map[string]int),
		ops:       make([]Operation, 0),
		content: Dict{
			"doc": "Haha this is is some text",
		}}
}

func TestDocumentValidOps(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}, Component{
		Path: []string{"doc", "12"},
		Sd:   "is ",
	}}
	err := doc.Apply(op1, doc.Checksum())

	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	result, _ := doc.content.get([]string{"doc"})
	if result != target {
		t.Errorf("simple Operation failed %q != %q", result, target)
	}
}

func TestDocumentConcurrentLeft(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	check := doc.Checksum()
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := Operation{Component{
		Path: []string{"doc", "7"},
		Sd:   "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//RIGHT OP
	err := doc.Apply(op2, check)
	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.Apply(op1, check)
	if err != nil {
		t.Errorf("Concurrent Left Operation failed (Error %q)", err)
	}
	result, _ := doc.content.get([]string{"doc"})
	if result != target {
		t.Errorf("Concurrent Left Operation failed %q != %q", result, target)
	}
}

func TestConcurrentRight(t *testing.T) {
	doc := newTestDocument()
	target := "Hahaho this is some text"
	check := doc.Checksum()
	op1 := Operation{Component{
		Path: []string{"doc", "4"},
		Si:   "ho",
	}}
	// Expecting Hahaho this is is some text
	op2 := Operation{Component{
		Path: []string{"doc", "7"},
		Sd:   "is ",
	}}
	// Expecting Haha this is some text
	// Combination of both should end up in Hahaho this is some text

	//LEFT OP
	err := doc.Apply(op1, check)
	if err != nil {
		t.Errorf("Simple Operation failed (Error %q)", err)
	}
	err = doc.Apply(op2, check)
	if err != nil {
		t.Errorf("Concurrent Right Operation failed (Error %q)", err)
	}
	result, _ := doc.content.get([]string{"doc"})
	if result != target {
		t.Errorf("Concurrent Right Operation failed %q != %q", result, target)
	}

}

func TestInvalidDeletes(t *testing.T) {
	doc := Document{
		checksums: make(map[string]int),
		content: Dict{
			"doc": "Haha this is is some text",
		}}
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Sd:   "is ",
	}}
	err := doc.Apply(op, doc.Checksum())
	if _, ok := err.(InvalidComponentError); !ok {
		t.Error("Invalid DELETE did not raise error")
	}
}

func BenchmarkApplyInserts(b *testing.B) {
	doc := newTestDocument()
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Si:   "ha ",
	}}
	for i := 0; i < b.N; i++ {
		doc.Apply(op, doc.Checksum())
	}
}

func BenchmarkApplyDeletes(b *testing.B) {
	doc := Document{
		checksums: make(map[string]int),
		ops:       make([]Operation, 0),
		content: Dict{
			"doc": "",
		}}
	op := Operation{Component{
		Path: []string{"doc", "0"},
		Sd:   "H",
	}}
	for i := 0; i < b.N; i++ {
		doc.Apply(op, doc.Checksum())
	}
}
